    id: FailedPrecondition
    path: src/Google.Api.CommonProtos/Rpc/Code.cs
    startLine: 159
  assemblies:
  - Google.Api.CommonProtos
  namespace: Google.Rpc
  summary: "\nThe operation was rejected because the system is not in a state\nrequired for the operation's execution.  For example, the directory\nto be deleted is non-empty, an rmdir operation is applied to\na non-directory, etc.\n\nService implementors can use the following guidelines to decide\nbetween `FAILED_PRECONDITION`, `ABORTED`, and `UNAVAILABLE`:\n(a) Use `UNAVAILABLE` if the client can retry just the failing call.\n(b) Use `ABORTED` if the client should retry at a higher level\n(e.g., restarting a read-modify-write sequence).\n(c) Use `FAILED_PRECONDITION` if the client should not retry until\nthe system state has been explicitly fixed.  E.g., if an \"rmdir\"\nfails because the directory is non-empty, `FAILED_PRECONDITION`\nshould be returned since the client should not retry unless\nthe files are deleted from the directory.\n\nHTTP Mapping: 400 Bad Request\n"
  example: []
  syntax:
    content: >-
      [OriginalName("FAILED_PRECONDITION")]

      FailedPrecondition = 9
    return:
      type: Google.Rpc.Code
    content.vb: >-
      <OriginalName("FAILED_PRECONDITION")>

      FailedPrecondition = 9
  attributes:
  - type: Google.Protobuf.Reflection.OriginalNameAttribute
    ctor: Google.Protobuf.Reflection.OriginalNameAttribute.#ctor(System.String)
    arguments:
    - type: System.String
      value: FAILED_PRECONDITION
